    this.state = {
      streamsList: [],
      moviesList: []
    }
  }


componentDidMount () {

	this.setState({
          streamsList: data.getStreams()
     })
}




render(){ 
		const displayStreams = this.state.streamsList.map((s,i)=> {
			return (<p className= "stream" id = {s.name} key={i}>)
		   		{s.name}
			</p>)
		})
	  return (
	    <div>
	    	<h1>Streams Page</h1>
			{displayStreams}
	    </div>
	  );
	};
  }

